import React, { useState, useEffect } from "react";



function Player(props){
const [playerInfo, setPlayerInfo] = useState({});
useEffect(() => {setPlayerInfo(props)}, 
    [props]);
console.log(playerInfo);
return (<div><p>Player {props.playerNumber + 1}: {playerInfo.props.summonerName}, K/D/A: {playerInfo.props.kills} / {playerInfo.props.deaths} / {playerInfo.props.assists}</p>
                <h1>Champion: {playerInfo.props.championName}</h1> <img src = {`http://ddragon.leagueoflegends.com/cdn/12.9.1/img/champion/${playerInfo.props.championName}.png`} alt = "Champion-Splash-Img"></img>
                <h3>Lane: {props.lane}</h3>
        </div>);
}

export default Player;
